      function searchHRMS() {
        const inputValue = document.getElementById("hrmsInput").value.trim(); // Fetch the input value
        const resultDiv = document.getElementById("result"); // Result container

        // Search for the HRMS ID in the JSON object
        const record = data.find((item) => item["HRMS ID"] === inputValue); // Match `HRMS ID`

        if (record) {
          // Display the result
          resultDiv.innerHTML = `
      <p><strong>Sr. No.:</strong> ${record["Sr. No."]}</p>
      <p><strong>Name of Employee:</strong> ${record["Name of Employee"]}</p>
      <p><strong>Booth No.:</strong> ${record["Booth No"]}</p>
      <p><strong>Booth Name:</strong> ${record["Station"]}</p>
      <p><strong>Office Name:</strong> ${record["Office Name"]}</p>
      

    `;
        } else {
          // If not found, display an error message
          resultDiv.innerHTML = `<p style="color: red;">No record found for HRMS ID: ${inputValue}</p>`;
        }
      }
